import { useParams } from "react-router-dom";
export default function Movie() {
  let params = useParams();
  return (
    <>
      <h3 className="title is-3">Movie {params.id}</h3>
      <table className="table is-striped is-fullwidth">
        <tbody>
          <tr>
            <th>Title:</th>
            <td>Some Movie</td>
          </tr>
          <tr>
            <th>Run Time:</th>
            <td>150 min</td>
          </tr>
        </tbody>
      </table>
    </>
  );
}
